import {Link} from 'react-router-dom';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';


function ShowProducts(){
    return(
        <Container maxWidth="md">
            <Button variant="text"><Link to='/' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Home</Link></Button>
            <Button variant="text"><Link to='/Inicio' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Inicio</Link></Button>
            <Button variant="text"><Link to='/form' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Formulario</Link></Button>
            <Button variant="text"><Link to='/Contacto' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Contacto</Link></Button>
            <Button variant="text"><Link to='/Nosotros' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Nosotros</Link></Button>
                <h2>Creando</h2>
        </Container>
    )
}
export default ShowProducts;
